import React from 'react';
import './style.css';

const Experience = () => {
    return (
        <section>
            <h2>Experiência Desenvolvedora (Voluntária)</h2>
            <ul>
                <li>
                    <h3>EmComp - Empresa Júnior da Computação</h3>
                    <p>Posição: Desenvolvedora Full-Stack</p>
                    <p>Regime: Tempo Integral</p>
                    <p>Período: Maio de 2023 - Presente</p>
                    <p>Localização: Rio Pomba, Minas Gerais, Brasil</p>
                    <p>Descrição: Trabalho voluntário como desenvolvedora Full-Stack
                       na EmComp, participando de projetos de desenvolvimento de software e soluções tecnológicas para clientes e parceiros da empresa júnior.</p>
                </li>
            </ul>
        </section>
    );
}

export default Experience;
